import "./WinnerMessage.scss";
import Buttons from "../Buttons/Buttons";

export default function WinnerMessage({ winnerName }) {
  return (
    <div id="myModal" className="modal">
      <div className="modal-content">
        <div className="center">
          <h3>{winnerName}fwef</h3>
          <div style={{ width: "100%" }} ><div style={{ height: '0', paddingBottom: '75%', position: 'relative', width: '100%' }}><iframe title="gif" allowfullscreen="" frameBorder="0" height="100%" src="https://giphy.com/embed/YTbXXmG5SNfvn0K6s0/video" style={{ left: '0', position: 'absolute', top: '0' }} width="100%"></iframe></div></div>
          <Buttons text="NEW GAME" />
        </div>
      </div>
    </div>
  )
}
